import base64

def convertToBase64(file_name):
    with open(file_name, "rb") as image_file:
        encoded_string = base64.b64encode(image_file.read())
        return encoded_string

def set_icon(root, dir):
    icone = base64.b64decode("")
    tempFile= dir+'/icons/'+"flytoken.ico"
    iconfile= open(tempFile,"wb")
    iconfile.write(icone)
    iconfile.close()
    root.iconbitmap(tempFile)

def set_png(dir):
    icone = base64.b64decode("")
    tmpFile= dir+'/icons/'+"bytoken.png"
    iconfile= open(tmpFile,"wb")
    iconfile.write(icone)
    iconfile.close()

